	(20,0,'','https://www.youtube.com/watch?v=2GbUbum1Yn4','Puff Futbol de Mipuf | El Deporte Rey hecho fútbol','Puf Fútbol de Mipuf.es | Un puf que imita con gran realismo y calidad a un balón de fútbol. Múltiples colres a elegir.\r\n\r\nConoce todos sus detalles en: http://www.mipuf.es/puff-futbol-p-528.html',''),
	(21,0,'','https://www.youtube.com/watch?v=wzcNH-HedXc','Mipuf | Pufs Deportivos','No lo pienses más: con los pufs deportivos atraerás a todos los amantes del deporte. El Puf futbol disponible en dos tamaños y ocho colores a elegir, también sirve para la decoración de eventos deportivos.\r\nLos amantes del baloncesto también tienen su puff deportivo al alcance de un sólo click. Divertido y original, puede elegirse en tricolor o en el clásico naranja de las pelotas de basket.','');
