	(332,72,0,1,'<p class=\"style52\" align=\"left\"><strong>Размери:</strong></p>\r\n<p class=\"style21\" align=\"left\"><span class=\"style51\">Приблизителни размери:</span><br />100см. в диаметър и 50см. височина на&nbsp;<br />облегалката - обем 380литра<br /><br /><span class=\"style51\">Вътрешно съдържание:</span><br />(пухкави кръгли гранули)<br /><br /><strong class=\"style51\">Тегло:</strong><br />4-6кг.<br /><br /><strong class=\"style51\">Форма:</strong>&nbsp;<br />Ябълка<br /><br /><strong>Снимките са на един и същи продукт в различни положения.</strong></p>\r\n<p class=\"style21\" align=\"left\"><span class=\"style51\">Поддръжка и почистване:</span><br />Барбарони от изкуствена кожа&nbsp;<br />се почистват с вода и сапун или ТЕСТ (зелен<br />гел за съдове и ръце) или препарат за естествена кожа.<br /><span class=\"style51\">ДА НЕ СЕ ИЗПОЛЗВАТ СПИРТ, АЦЕТОН, АЛКОХОЛ, ПРЕПАРАТ ЗА ПРОЗОРЦИ ИЛИ ДРУГИ РАЗТВОРИТЕЛИ!!!</span><br /><br />Барбароните от дамаска притежават вътрешен специален калъф за изваждане на пълнежа и съхранение. Всички барбарони от дамаска се перат на 30 градуса без центрофуга и сушилня<br />За повече подробности при необходимост се свържете с нас.</p>\r\n<p class=\"style21\" align=\"left\"><span class=\"style21\"><strong>Патентован продукт!&nbsp;</strong><br />Всички продукти в този сайт са произведени, проектирани и патентовани от екипа на \"Барбарон БГ\" ЕООД и са с гарантирано качество, оригинални форми и тествани материали.<br />Всички други копия са незаконни и не отговарят на системи за качество, без контрол и крият своите опасности</span><span>!</span></p>'),
	(334,73,0,1,'<p>Барбарон тип \"Ябълка\" е с кръгла форма, по ниска, не толкова ясно изразена облегалка както крушата, но и тя си има своите предимства. С по спортната си форма Ябълката е предпочитан модел заради по малкия си размер и по ниската си цена, но в никакъв случай не отстъпва по комфорт и удобство на своята съпернича.&nbsp;<br />Както всички продукти на Барбарон БГ, Ябълката се предлага в три варианта, дамаска, изкуствена кожа и специална промазана дамаска за външни условия. Всички модели от дамаска имат специален калъф за пране и профилактика.&nbsp;</p>'),
