	(431,72,0,13,'<p><span class=\"style21\"><strong>Забележка!&nbsp;<br />Твърдите кубчета се изработват само от изкуствена кожа!</strong></span><br /><span class=\"style21\">Меките кубчета могат да бъдат изработени от кожа, дамаска и промазан плат.</span><br /><br /><span class=\"style21\"><strong>Пълнеж:</strong>&nbsp;<br />твърд стиропорен блок + 5см дунапренен лист за твърдо кубче и гранули за меко кубче&nbsp;</span><br /><br /><span class=\"style52\">Цена за доставка</span><span class=\"style21\">&nbsp;на един брой кубче, варира от 10лв. до 20лв. в зависимост от населеното място. При повече от един брой се взема средна цена. Цената за доставка в гр. София е 10лв. или безплатна при получаване в наш офис или магазин.</span><br /><br /><span class=\"style21\"><span class=\"style51\">Поддръжка и почистване:</span>&nbsp;Кубчета от изкуствена кожа&nbsp;<br />се почистват с вода, сапун, ТЕСТ (зелен<br />гел за съдове и ръце) или препарат за естествена кожа.<br /><span class=\"style51\">ДА НЕ СЕ ИЗПОЛЗВАТ СПИРТ, АЦЕТОН, АЛКОХОЛ, ПРЕПАРАТ ЗА ПРОЗОРЦИ ИЛИ ДРУГИ РАЗТВОРИТЕЛИ!!!</span><br />Кубче от дамаска притежава вътрешен калъф за пране, а калъфката се пере в пералня при температура от 30 градуса.</span></p>'),
	(432,72,0,129,'<p class=\"style52\" align=\"left\"><strong>Размери:</strong></p>\r\n<p class=\"style21\" align=\"left\"><span class=\"style51\">Приблизителни размери:</span><br />100см. в диаметър и 50см. височина на&nbsp;<br />облегалката - обем 380литра<br /><br /><span class=\"style51\">Вътрешно съдържание:</span><br />(пухкави кръгли гранули)<br /><br /><strong class=\"style51\">Тегло:</strong><br />4-6кг.<br /><br /><strong class=\"style51\">Форма:</strong>&nbsp;<br />Ябълка<br /><br /><strong>Снимките са на един и същи продукт в различни положения.</strong></p>\r\n<p class=\"style21\" align=\"left\"><span class=\"style51\">Поддръжка и почистване:</span><br />Барбарони от изкуствена кожа&nbsp;<br />се почистват с вода и сапун или ТЕСТ (зелен<br />гел за съдове и ръце) или препарат за естествена кожа.<br /><span class=\"style51\">ДА НЕ СЕ ИЗПОЛЗВАТ СПИРТ, АЦЕТОН, АЛКОХОЛ, ПРЕПАРАТ ЗА ПРОЗОРЦИ ИЛИ ДРУГИ РАЗТВОРИТЕЛИ!!!</span><br /><br />Барбароните от дамаска притежават вътрешен специален калъф за изваждане на пълнежа и съхранение. Всички барбарони от дамаска се перат на 30 градуса без центрофуга и сушилня<br />За повече подробности при необходимост се свържете с нас.</p>\r\n<p class=\"style21\" align=\"left\"><span class=\"style21\"><strong>Патентован продукт!&nbsp;</strong><br />Всички продукти в този сайт са произведени, проектирани и патентовани от екипа на \"Барбарон БГ\" ЕООД и са с гарантирано качество, оригинални форми и тествани материали.<br />Всички други копия са незаконни и не отговарят на системи за качество, без контрол и крият своите опасности</span><span>!</span></p>'),
	(433,73,0,129,'<p>Барбарон тип \"Ябълка\" е с кръгла форма, по ниска, не толкова ясно изразена облегалка както крушата, но и тя си има своите предимства. С по спортната си форма Ябълката е предпочитан модел заради по малкия си размер и по ниската си цена, но в никакъв случай не отстъпва по комфорт и удобство на своята съпернича.&nbsp;<br />Както всички продукти на Барбарон БГ, Ябълката се предлага в три варианта, дамаска, изкуствена кожа и специална промазана дамаска за външни условия. Всички модели от дамаска имат специален калъф за пране и профилактика.&nbsp;</p>');
