	(13,72,'Забележка!&nbsp;Твърдите кубчета се изработват само от изкуствена кожа!Меките кубчета могат да бъдат изработени от кожа, дамаска и промазан плат.Пълнеж:&nbsp;твърд стиропорен блок + 5см дунапренен лист за твърдо кубче и гранули за меко кубче&nbsp;Цена за доставка&nbsp;на един брой кубче, варира от 10лв. до 20лв. в зависимост от населеното място. При повече от един брой се взема средна цена. Цената за доставка в гр. София е 10лв. или безплатна при получаване в наш офис или магазин.Поддръжка и почистване:&nbsp;Кубчета от изкуствена кожа&nbsp;се почистват с вода, сапун, ТЕСТ (зеленгел за съдове и ръце) или препарат за естествена кожа.ДА НЕ СЕ ИЗПОЛЗВАТ СПИРТ, АЦЕТОН, АЛКОХОЛ, ПРЕПАРАТ ЗА ПРОЗОРЦИ ИЛИ ДРУГИ РАЗТВОРИТЕЛИ!!!Кубче от дамаска притежава вътрешен калъф за пране, а калъфката се пере в пералня при температура от 30 градуса.'),
