	(129,72,'Размери: Приблизителни размери:100см. в диаметър и 50см. височина на&nbsp;облегалката - обем 380литраВътрешно съдържание:(пухкави кръгли гранули)Тегло:4-6кг.Форма:&nbsp;ЯбълкаСнимките са на един и същи продукт в различни положения. Поддръжка и почистване:Барбарони от изкуствена кожа&nbsp;се почистват с вода и сапун или ТЕСТ (зеленгел за съдове и ръце) или препарат за естествена кожа.ДА НЕ СЕ ИЗПОЛЗВАТ СПИРТ, АЦЕТОН, АЛКОХОЛ, ПРЕПАРАТ ЗА ПРОЗОРЦИ ИЛИ ДРУГИ РАЗТВОРИТЕЛИ!!!Барбароните от дамаска притежават вътрешен специален калъф за изваждане на пълнежа и съхранение. Всички барбарони от дамаска се перат на 30 градуса без центрофуга и сушилняЗа повече подробности при необходимост се свържете с нас. Патентован продукт!&nbsp;Всички продукти в този сайт са произведени, проектирани и патентовани от екипа на \"Барбарон БГ\" ЕООД и са с гарантирано качество, оригинални форми и тествани материали.Всички други копия са незаконни и не отговарят на системи за качество, без контрол и крият своите опасности!'),
	(129,73,'Барбарон тип \"Ябълка\" е с кръгла форма, по ниска, не толкова ясно изразена облегалка както крушата, но и тя си има своите предимства. С по спортната си форма Ябълката е предпочитан модел заради по малкия си размер и по ниската си цена, но в никакъв случай не отстъпва по комфорт и удобство на своята съпернича.&nbsp;Както всички продукти на Барбарон БГ, Ябълката се предлага в три варианта, дамаска, изкуствена кожа и специална промазана дамаска за външни условия. Всички модели от дамаска имат специален калъф за пране и профилактика.&nbsp;'),
